import Navbar from './Components/Navbar';
import React, { Component } from 'react';
import News from './Components/News';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import LoadingBar from 'react-top-loading-bar';
const App = () => {
  pageSize = 5;
  apikey = process.env.REACT_APP_NEWS_API;
  state = {
    progress: 0,
  };

  setProgress = (progress) => {
    this.setState({ progress: progress });
  };

  return (
    <Router>
      <Navbar />

      <LoadingBar color='#f11946' progress={this.state.progress} height={5} />

      <Routes>
        <Route
          exact
          path='/'
          element={
            <News
              apikey={this.apikey}
              setProgress={this.setProgress}
              key={'general'}
              pageSize={6}
              country='in'
              category='general'
            />
          }
        />
        <Route
          exact
          path='/business'
          element={
            <News
              apikey={this.apikey}
              setProgress={this.setProgress}
              key={'business'}
              pageSize={6}
              country='in'
              category='business'
            />
          }
        />
        <Route
          exact
          path='/entertainment'
          element={
            <News
              apikey={this.apikey}
              setProgress={this.setProgress}
              key={'entertainment'}
              pageSize={6}
              country='in'
              category='entertainment'
            />
          }
        />
        <Route
          exact
          path='/health'
          element={
            <News
              apikey={this.apikey}
              setProgress={this.setProgress}
              key={'health'}
              pageSize={6}
              country='in'
              category='health'
            />
          }
        />
        <Route
          exact
          path='/science'
          element={
            <News
              apikey={this.apikey}
              setProgress={this.setProgress}
              key={'science'}
              pageSize={6}
              country='in'
              category='science'
            />
          }
        />
        <Route
          exact
          path='/sports'
          element={
            <News
              apikey={this.apikey}
              setProgress={this.setProgress}
              key={'sports'}
              pageSize={6}
              country='in'
              category='sports'
            />
          }
        />
        <Route
          exact
          path='/technology'
          element={
            <News
              apikey={this.apikey}
              setProgress={this.setProgress}
              key={'technology'}
              pageSize={6}
              country='in'
              category='technology'
            />
          }
        />
      </Routes>
    </Router>
  );
};

export default App;
